window.bookSummaryJSON = "<p>Old allies go dark.... New worlds join the fight.... A rescue from an enemy held world.... A lone operative with a dangerous plan....</p> <p>The Karuzari finally have the support of an industrialized system, but they need time to build their forces.</p> <p>Unfortunately, time is the one thing they may not have. Captain Scott now faces a difficult decision: To risk it all on a single roll-of-the-dice, or to turn his back on an old friend, and a plan that could buy them the time they so desperately need?</p>"; 
